import React from 'react';
import ReactDOM from 'react-dom';
import Header from './Header'
import ToDoList from './ToDoList';


function App() {
  const [group, setGroup] = React.useState([])

  function addNewGroup(e) {

    const newGroup = {
      title: '',
      id: group.length - 1,
      type: "text",
    }
    setGroup(prevGroup => {
      return [...prevGroup, newGroup]
    })
  }

  function handleChange(e) {
    e.preventDefault();
    setGroup(prevGroup => {
      return [
        prevGroup.title = e.target.value,
        ...prevGroup
      ]
    })
  }

  return (
    <div className="App">
      <Header
        addNewGroup={addNewGroup}
      />
      <ToDoList
        group={group}
      />
    </div>
  );
}

export default App;
